import React from 'react'
import Dashboard from '../Dashboard'
import {Link} from 'react-router-dom'
import styled from 'styled-components'

export default function Movies() {
    return (
        <>
            <Dashboard/>
            <Header>
                <h1 className="pageHeader">My Profile</h1>
            </Header>
            <div>
                <Image>
                    <img style={{width: "160px", height: "160px"}} src="https://media.istockphoto.com/vectors/default-profile-picture-avatar-photo-placeholder-vector-illustration-vector-id1223671392?k=6&m=1223671392&s=612x612&w=0&h=NGxdexflb9EyQchqjQP0m6wYucJBYLfu46KCLNMHZYM=" alt=""/>
                </Image>
                <Email><h2>randomr@email.com</h2></Email>
                <Box1>
                    <Title>
                        <h3>Pesonal Information </h3>
                    </Title>
                    <Text>
                        <h6>Age: 20</h6>
                        <h6>Gender: M/month</h6>
                    </Text>
                    <RemoveLink><Link>Edit Information</Link></RemoveLink>
                </Box1>
                <Box2>
                    
                </Box2>
            </div>

        </>
    )
}

const Header = styled.div`
    margin-left: 240px; 
    margin-top: 10px;
`
const Image = styled.div` 
    border-radius: 80px; 
    margin-left: 700px; 
    margin-top: 50px;
`

const Email = styled.div `
    margin-left: 680px; 
    margin-top: 10px;
`

/**Build a Recipe App With React | React Tutorial For Beginners https://www.youtube.com/watch?v=U9T6YkEDkMo&list=PLDyQo7g0_nsVHmyZZpVJyFn5ojlboVEhE&index=2 */
const Box1 = styled.div`
    margin-top: 30px; 
    margin-bottom: 20px; 
    border-radius: 10px;
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);  
    margin-left: 400px; 
    background: white;
    height: 150px; 
    width: 800px; 
`

/**Build a Recipe App With React | React Tutorial For Beginners https://www.youtube.com/watch?v=U9T6YkEDkMo&list=PLDyQo7g0_nsVHmyZZpVJyFn5ojlboVEhE&index=2 */
const Box2 = styled.div`
    margin-top: 30px; 
    margin-bottom: 20px; 
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    align-item: center; 
    border-radius: 10px;
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);  
    margin-left: 400px; 
    background: white;
    min-height: 30px 
    width: 800px; 
`
const Title = styled.div `
    margin-top: 30px;
    margin-left: 30px;
`
const Text = styled.div`
`
